(10030, 8469, 1159, 8, 'Black & White', '', '1997-07-15 00:00:00', 0000, 20, 0, 4, '', 'Unravel me, a distant cord\nOn the outside is forgotten\nA constant need to get along\nAnd the animal awakens\nAnd all I feel is black and white\n\nThe road is long\nThe memory slides\nTo the whole of my undoing\nPut aside, I put away\nI push it back to get through each day\n\nAnd all I feel is black and white\nAnd I''m wound up small and tight\nAnd I don''t know who I am\n\nEverybody loves you when you''re easy\nEverybody hates when you''re a bore\nEveryone is waiting for your entrance\nSo don''t disappoint them\n\nUnravel me, untie this chord\nThe very center of our union\nIs caving in, I can''t endure\nI am the archive of our failure\n\nAnd all I feel is black and white\nAnd I''m wound up\nSmall and tight\nAnd I don''t know who I am\n\nEverybody loves you when you''re easy\nEverybody hates when you''re a bore\nEveryone is waiting for your entrance\nSo don''t disappoint them\n\nEverybody loves you when you''re easy\nSo don''t disappoint them\nDon''t disappoint them\nDon''t disappoint them\nDon''t disappoint them\n', 303, '', '', '', '', '', '', 0, 1, 0, '2008-12-16 17:50:27', '2015-03-12 13:35:26', '0000-00-00 00:00:00'),
(10031, 8469, 1159, 9, 'Full Of Grace', '', '1997-07-15 00:00:00', 0000, 20, 0, 4, '', 'The winter here''s cold and bitter \nIt''s chilled us to the bone \nWe haven''t seen the sun for weeks \nTo long too far from home \nI feel just like I''m sinking \nAnd I claw for solid ground \nI''m pulled down by the undertow \nI never thought I could feel so low \nOh darkness I feel like letting go \nIf all of the strength and all of the courage \nCome and lift me from this place \nI know I could love you much better than this \nFull of grace \nFull of grace \nMy love \nSo it''s better this way, I said \nHaving seen this place before \nWhere everything we said and did \nHurts us all the more \nIts just that we stayed, too long \nIn the same old sickly skin \nI''m pulled down by the undertow \nI never thought I could feel so low \nOh darkness I feel like letting go \nIf all of the strength \nAnd all of the courage \nCome and lift me from this place \nI know I could love you much better than this \nFull of grace \nFull of grace \nMy love', 221, '', '', '', '', '', '', 0, 1, 0, '2008-12-16 17:51:27', '2015-03-12 13:35:26', '0000-00-00 00:00:00'),
(10032, 8469, 1159, 10, 'Last Dance', '', '1997-07-15 00:00:00', 0000, 20, 0, 4, '', 'I have a smile \nstretched from ear to ear \nto see you walking down the road \nwe meet at the lights \nI stare for a while \nthe world around us disappears \nit''s just you and me \non my island of hope \na breath between us could be miles \nlet me surround you \nmy sea to your shore \nlet me be the calm you seek \noh and every time I''m close to you \nthere''s too much I can''t say \nand you just walk away \nand I forgot \nto tell you \nI love you \nand the night''s \ntoo long \nand cold here \nwithout you \nI grieve in my condition \nfor I cannot find the words to say i need you so \noh and every time I''m close to you \nthere''s too much I can''t say \nand you just walk away \nand I forgot \nto tell you \nI love you \nand the night''s \ntoo long \nand cold here \nwithout you \nI grieve in my condition \nfor I cannot find the words to say I need you so ', 152, '', '', '', '', '', '', 0, 1, 0, '2008-12-16 17:52:12', '2015-03-12 13:35:27', '0000-00-00 00:00:00'),
