(10044, 8469, 1161, 5, 'Hold On', '', '1995-03-28 00:00:00', 0000, 20, 0, 4, '', 'Hold on \nHold on to yourself \nFor this is gonna hurt like hell. \n\nHold on \nHold on to yourself. \nYou know that only time can tell \n\nWhat is it in me that refuses to believe \nThis isn''t easier than the real thing. \n\nMy love \n\nYou know that you''re my best friend. \nYou know that I''d do anything for you \nAnd my love \nLet nothing come between us \nMy love for you is strong and true. \n\nAm I in heaven here or \nAm I\nAt the crossroads I am standing. \n\nSo now you''re sleeping peaceful \nI lie awake and pray \nThat you''ll be strong tomorrow \nAnd will see another day \nAnd we will praise it \nAnd love the light that brings a smile \nAcross your face. \n\nOh God, \nIf you''re out there won''t you hear me. \nI know that we''ve never talked before \n\nAnd oh God,\nThe man I love is leaving \nWon''t you take him when he comes to your door. \n\nAm I in heaven here or \nAm I in hell \nAt the crossroads I am standing. \n\nSo now you''re sleeping peaceful \nI lie awake and pray \nThat you''ll be strong tomorrow \nAnd we''ll see another day \nAnd we will praise it \nAnd love the light that brings a smile \nNow you''re sleeping peaceful\nI lie awake and pray\nThat you''ll be strong tomorrow\nAnd we''ll see another day\nAnd we will praise it\nAnd love the light that brings a smile\nAcross your face\n\nHold on \nHold on to yourself \nFor this is gonna hurt like hell.', 405, '', '', '', '', '', '', 0, 1, 0, '2008-12-16 18:02:00', '2015-03-12 13:35:27', '0000-00-00 00:00:00'),
