(10138, 8489, 0, 1, '懺悔文', '這首詞，是由不才的我所寫，吉他手小蔡的曲，大家亂搞的編曲~~加上是我唱的，聽過的人都說是佛經...\r\n\r\n但我不覺得~~我倒覺得，像"靜思語" \r\n\r\n證嚴法師，您說是吧~~', '0000-00-00 00:00:00', 0000, 0, 1, 1, '行在助人菩薩道\r\n奔馳圓形運動場\r\n長情大愛不停歇\r\n牽引苦難坎坷路\r\n\r\n口白：往昔所造諸惡業 皆由無始貪瞋癡 \r\n　　　從身語意之所生 今在佛前求懺悔\r\n\r\n世間大地相連接\r\n縱有高山和大海\r\n只因高地起伏雜\r\n並未阻斷連結難\r\n\r\n口白：懺者：懺其前衍\r\n　　　悔者：悔其後過\r\n　　　所有惡業 今已覺悟\r\n　　　悉皆永斷 更不復作\r\n\r\n行在輪迴菩薩道\r\n苦難人間幾回受\r\n無常生命陷泥淖\r\n只為來生求解脫\r\n\r\n過往雲煙 今不復見\r\n夢裡功名 始還本心\r\n\r\n昔諸惡業 始貪瞋癡\r\n意之所生 今皆懺悔\r\n\r\n', '', 260, '', '小蔡', '拉爺', '', '', '', 0, 1, 0, '2008-12-17 17:13:32', '2015-03-12 13:35:30', '0000-00-00 00:00:00'),
