(10164, 8489, 0, 1, '愛戀', '為了日益頻繁的網路戀情   寫點東西...', '0000-00-00 00:00:00', 0000, 0, 1, 7, '虛擬的網路世界  劃破彼此的界限\r\n讓我有機會  能夠  看清妳的臉\r\n蠢蠢欲動的鮮血  在每個想妳的夜  能得到告解\r\n\r\n不會想急著見面  只看著妳的留言\r\n讓我有機會  能夠  看清妳的甜\r\n似是而非的畫面  在每個想妳的夜  越來越明顯\r\n\r\n對妳的愛戀  越來越強烈  每一天都有增無減\r\n思念像  海一般  無限的蔓延　發現愛　不會走遠\r\n\r\n對妳的愛戀  越來越強烈  每一次都讓人淪陷\r\n閉上眼  一瞬間  又再次想念  一直都  活在彼此間          　', '', 289, '', '拉爺', '拉爺', 'guys', '', '', 0, 1, 0, '2008-12-17 17:48:33', '2015-03-12 13:35:31', '0000-00-00 00:00:00'),
