(10170, 8489, 0, 1, '媽媽', '05年送給娘的母親節禮物...', '0000-00-00 00:00:00', 0000, 0, 1, 4, '\r\n  自從細漢時袸  媽媽丟陪伴阮\r\n  叫阮愛呷卡多  會一暝大一吋\r\n  教阮人情世事  遇困難愛吞忍\r\n  賣嘎郎來計較  做好自己本份\r\n\r\n  為丟咱一口灶  失去了伊青春 \r\n  不管生活多壞  艱苦自己來吞   \r\n  把囡囝養大漢  ㄟ凍力足生存  \r\n  雖然過程困難  但永遠不認輸\r\n  \r\n  媽媽  請妳丟愛詳細聽  哪無妳丟無今哪日ㄟ我  \r\n  雖然不係金好命  一家和樂金快活  \r\n  賺的錢丟倒倒阿侃  總有一工ㄟ好野\r\n  \r\n  媽媽  請妳丟愛詳細聽  哪想要一步登天無卡紙  \r\n  雖然頭前路歹走   身體健康卡快活  \r\n  賣生氣心情放輕鬆  我一定ㄟ甲妳惜命命', '', 264, '', '', '', '', '', '', 0, 1, 0, '2008-12-17 18:00:07', '2015-03-12 13:35:32', '0000-00-00 00:00:00'),
(10171, 315, 0, 1, 'I Should Take (demo)', 'we build something up\r\nwe destroy ourselves\r\n\r\n我們建構一些假象\r\n我們也摧毀了自己', '0000-00-00 00:00:00', 0000, 0, 1, 7, '亂唱', '', 150, '', 'Ever', '', '', '', '', 0, 0, 1, '2008-12-17 18:49:13', '2013-10-07 17:13:27', '0000-00-00 00:00:00'),
(10172, 8489, 0, 1, 'Limelight', '這首是 cover 自加拿大老團 RUSH- "Limelight" , 很不好練，很多地方都沒對到，當作是練習，有機會再重錄一次......', '0000-00-00 00:00:00', 0000, 0, 1, 1, '', '', 522, '', 'RUSH', 'RUSH', '', '', '', 0, 1, 0, '2008-12-17 20:19:56', '2015-03-12 13:35:32', '0000-00-00 00:00:00'),
(10173, 8489, 0, 1, '阿娘ㄟ衫', '這是去年母親節的禮物...\r\n只是  此次的編曲用了GP 譜當background ，加上在發燒的情形下作的，實在是有辱母親偉大的光輝~~\r\n\r\n過陣子  等錄音器材更新之後，找時間再重錄一次吧...\r\n\r\n(不可誨言的  拉爺我還是比較擅長寫台語歌~~~~)', '0000-00-00 00:00:00', 0000, 0, 1, 5, '阿娘ㄟ衫  卡穿嘛係那幾件\r\n自少年到今嘛   一直是那麼勤拑\r\n為著生活  從來不曾想要趴\r\n和阿爹兩人   共同為生活打拼\r\n\r\n阿娘ㄟ衫  卡穿嘛係那幾件\r\n自少年到今嘛   一直是那麼勤拑\r\n為著囝仔  牽腸掛肚很多項\r\n艱苦自己擔   疼仔ㄟ心袂輕鬆\r\n\r\n阿娘ㄟ衫.....阿娘ㄟ衫.....\r\n細漢就熟識ㄟ形影\r\n就算畏寒     就算破空\r\n看在眼裡使人不甘  \r\n\r\n阿娘ㄟ衫.....阿娘ㄟ衫.....\r\n溫柔ㄟ雙手金體貼\r\n不管日晒     不管雨淋\r\n妳ㄟ偉大     我們會對著走', '', 209, '', '拉爺', '拉爺', '拉爺', '它馬的', '', 0, 1, 0, '2008-12-17 20:35:11', '2015-03-12 13:35:32', '0000-00-00 00:00:00'),
